import Layout from "../components/Layout";
import Head from "next/head";

const About = () => {
  return (
    <Layout>
      <style jsx>
        {`
          h2 {
            color: green;
          }
        `}
      </style>
      <h2>안녕하세요 저는 Yeom Jae Seon입니다.</h2>
    </Layout>
  );
};

export default About;
